  [],\n\t\"revision_timestamp\": \"2016-10-15T16:35:36.203820\",\n\t\"name\": \"narrative-report-montezuma-national-wildlife-refuge-calendar-year-1971\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Montezuma
  National Wildlife Refuge outlines Refuge accomplishments during the 1971 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
  section discusses physical developments. Resource management is outlined; topics
  include grazing and fur harvesting. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, violations, and
  safety. Items of interest, N-R forms, newspaper articles, and photographs are attached.\",\n\t\"license_title\":
